import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({
  children, isGoogleSignIn, inverted, ...otherButtonProps
}) => (
  <button
    className={
        `${inverted ? 'inverted' : ''}
         ${isGoogleSignIn ? 'google-sign-in' : ''}
         custom-button`
      }
    {...otherButtonProps}
  >
    {children}
  </button>
);

export default CustomButton;
